import React from "react";
import logo from "./logo.svg";
import itunes from "./itunes.svg";
import instagram from "./instagram.png";
import spotify from "./spotify.png";
import youtube from "./youtube.png";
import { Links } from "./Link";
import "./App.css";

function App() {
  const links = [
    ["/spotify.png", "https://bit.ly/LAURENT-SPOTIFY"],
    ["/applemusic.svg", "https://bit.ly/LAURENT-APPLE-MUSIC"],
    ["/tidal.png", "https://bit.ly/LAURENT-TIDAL"],
    ["/youtube.png", "https://bit.ly/LAURENT-YOUTUBE-CHANNEL"],
    ["/soundcloud.png", "https://bit.ly/LAURENT-SOUNDCLOUD"]
  ];
  return (
    <div className="App">
      <Links links={links} />
    </div>
  );
}

export default App;
